import React, { useState } from "react";
import jsPDF from "jspdf";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    jobAddress: "",
    jobType: "",
    moistureReadings: "",
    equipmentUsed: "",
    techNotes: "",
    paymentStatus: "",
    customerPaid: "",
    waitingInsurance: "",
    insuranceCompany: "",
    claimNumber: "",
  });

  const [aiSummary, setAiSummary] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  // ----------------------------------------
  // UPDATE FORM INPUTS
  // ----------------------------------------
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // ----------------------------------------
  // AI SUMMARY â€“ CALLS BACKEND
  // ----------------------------------------
  const generateAISummary = async () => {
    setIsLoading(true);
    try {
      const res = await fetch("http://localhost:5000/generate-ai-summary", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ formData }),
      });
      const data = await res.json();
      setAiSummary(data.aiSummary);
    } catch (err) {
      console.error(err);
      alert("AI summary failed.");
    }
    setIsLoading(false);
  };

  // ----------------------------------------
  // SAVE REPORT TO MONGO
  // ----------------------------------------
  const saveReport = async () => {
    try {
      const res = await fetch("http://localhost:5000/save-report", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ formData, aiSummary }),
      });
      const data = await res.json();
      alert("Report Saved to Database!");
    } catch (err) {
      console.error(err);
      alert("Save failed.");
    }
  };

  return (
    <div style={{ maxWidth: "700px", margin: "auto", padding: "20px" }}>
      <h2>ðŸ›  ToolbeltAI Mitigation Daily Log</h2>

      <input name="jobAddress" placeholder="Job Address" onChange={handleChange} />
      <input name="jobType" placeholder="Type of Job (Water, Fire, Mold...)" onChange={handleChange} />
      <textarea name="moistureReadings" placeholder="Moisture Readings" onChange={handleChange} />
      <textarea name="equipmentUsed" placeholder="Equipment Used" onChange={handleChange} />
      <textarea name="techNotes" placeholder="Technician Notes" onChange={handleChange} />

      {/* PAYMENT SECTION */}
      <h3>ðŸ’° Payment & Insurance</h3>
      <select name="paymentStatus" onChange={handleChange}>
        <option value="">Select Payment Status</option>
        <option value="Paid">Paid</option>
        <option value="Pending">Pending</option>
        <option value="Waiting for Insurance">Waiting for Insurance</option>
      </select>

      <select name="customerPaid" onChange={handleChange}>
        <option value="">Did Customer Pay Out of Pocket?</option>
        <option value="Yes">Yes</option>
        <option value="No">No</option>
      </select>

      <select name="waitingInsurance" onChange={handleChange}>
        <option value="">Waiting on Insurance?</option>
        <option value="Yes">Yes</option>
        <option value="No">No</option>
      </select>

      <input name="insuranceCompany" placeholder="Insurance Company" onChange={handleChange} />
      <input name="claimNumber" placeholder="Claim Number" onChange={handleChange} />

      {/* ------------- AI BUTTON ------------- */}
      <button onClick={generateAISummary} disabled={isLoading} style={{ marginTop: "15px" }}>
        {isLoading ? "Generating AI Report..." : "ðŸ¤– Generate AI Summary"}
      </button>

      {/* ------------- SHOW AI SUMMARY IF EXISTS ------------- */}
      {aiSummary && (
        <>
          <h3>ðŸ§  AI Summary:</h3>
          <p style={{ background: "#f7f7f7", padding: "10px", borderRadius: "6px" }}>{aiSummary}</p>

          {/* SAVE TO DATABASE */}
          <button onClick={saveReport} style={{ background: "green", color: "white", marginTop: "10px" }}>
            ðŸ’¾ Save Report to Database
          </button>
        </>
      )}
    </div>
  );
};

export default MitigationForm;
